import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <span>
        <Link to="/">
          <h1>EcoSunscreen</h1>
        </Link>
      </span>
      <span>
        <Link to="/about">
          <h2>About Us</h2>
        </Link>
      </span>
      <span>
        <Link to="/products">
          <h2>Products</h2>
        </Link>
      </span>
    </nav>
  );
}

export default Navbar;
